import React, { Component } from "react";
import { Table, Input, Select, Radio, Pagination } from "antd";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { transactDetailsActions } from "./duck/actions";
import { withRouter } from "react-router-dom";

class TransactionDetails extends Component {
    constructor(props) {
      super(props);
      this.state = {
        pagination: {
          page: 0,
          size: 10
        },
      };
    }

    componentDidMount() {
        this.setState({}, 
            async () => {
                this.props.loadTransactionDetails();
            });
    }

    render() {
        return (
            <React.Fragment>
                <p>
                Hello
                </p>
            </React.Fragment>
        )
    }

}

function mapStateToProps(state) {
    return {
      transactionDetails: state.rfqDetails.primaryBankRFQs
    };
  }

const actionCreators = {
    retrieveTransactionDetails: transactDetailsActions.loadTransactionDetails
  };
  const withRouteTransactionDetails = withRouter(TransactionDetails);
  export default connect(
    mapStateToProps,
    actionCreators
  )(withRouteTransactionDetails);
